CREATE TABLE m_accessory_passive_skill_level(
  accessory_passive_skill_master_id INTEGER NOT NULL,
  skill_level INTEGER NOT NULL,
  name TEXT NOT NULL,
  description TEXT NOT NULL,
  PRIMARY KEY (accessory_passive_skill_master_id, skill_level),
  FOREIGN KEY (accessory_passive_skill_master_id) REFERENCES m_accessory_passive_skill(id)
);
